export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},Hqz4MuyHjn:{data:{id:1782,attributes:{imdbId:"tt0089424",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTUzOTg0MDEwOV5BMl5BanBnXkFtZTcwNTg1OTM2MQ@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.3\u002F10"},{Source:"Rotten Tomatoes",Value:"87%"},{Source:"Metacritic",Value:"80\u002F100"}],item_lang:{data:{id:2445,attributes:{title:e,plot:"Luis Molina and Valentin Arregui are cell mates in a South American prison. Luis, a trans individual, is found guilty of immoral behavior and Valentin is a political prisoner. To escape reality Luis invents romantic movies, while Valentin tries to keep his mind on the situation he's in. During the time they spend together, the two men come to understand and respect one another.",slug:"kiss-of-the-spider-woman"}}},books:{data:[{id:9124,attributes:{title:e,description:"In an Argentine prison, the growing friendship between a thirty-seven-year-old homosexual, Molina, and a young Marxist, Valentin, is threatened when police officials start pressuring Molina to spy against Valentin",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-9VkAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:h,publisher:"Vintage",subtitle:a}},{id:9125,attributes:{title:"Kiss of the Spider Woman and Two Other Plays",description:"Compiled together for the first time, here are three plays by Argentine novelist and playwright Manual Puig: the well-known Kiss of the Spider Woman, a sharply provocative tale of love, victimization, and fantasy, and of the friendship that develops between two strikingly different men imprisoned together in a Latin American jail; Puig's first drama written directly for the stage, Under a Mantle of Stars, a recurring dream that is never ending; and Mystery of the Rose Bouquet, an astute tale of deep compassion and illusion. This is convincing proof that Manual Puig was one of our most talented writers - no matter what the medium. Puig is the author of seven novels, translated into fourteen languages.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6wrXprexonoC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"1994-01-01",publisher:"W. W. Norton & Company",subtitle:a}},{id:9126,attributes:{title:"Kiss of a Spider Woman (Mandarin Edition)",description:"《蜘蛛女之吻》 In the still darkness of their cell, Molina re-weaves the glittering and fragile stories of the film he loves, and the cynical Valentin listens. Valentin believes in the just cause which makes all suffering bearable; Molina believes in the magic of love which makes all else endurable. Each has always been alone, and always - especially now - in danger of betrayal. But in cell 7 each surrenders to the other something of himself that he has never surrendered before. 在阿根廷布宜诺斯艾利斯监狱的一间牢房里关押着两个囚犯，一个是政治犯瓦伦丁，另一个是同性恋者莫利纳，特务机关派到瓦伦丁身边的卧底。两人之间展开了一场奇妙的对话，呈现出一幅幅电影与现实交错的画面。本书1976年发表后，被翻译成多种文字，小说的魅力迅速蔓延开去，转化到各种表现形式：歌舞剧多年来久演不衰，成为百老汇经典；改编的电影产生过巨大的影响。",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=aJOrAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2014-02-25",publisher:"Simon and Schuster",subtitle:a}},{id:9127,attributes:{title:"Kiss of the Spider Womaná",description:a,thumbnail:a,authors:[c],firstBook:d,published:h,publisher:a,subtitle:a}},{id:9128,attributes:{title:e,description:a,thumbnail:a,authors:["Hector Babenco"],firstBook:d,published:"1990-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681703545383}}("","movie","Manuel Puig",null,"Kiss of the Spider Woman","series",1,"1991-01-01"))